import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Route} from 'react-router-dom';
import Home from "./Pages/home";

function App() {
  return (
    <div>
      <Route path='/' exact>
        <Home/>
      </Route>
    </div>
  );
}

export default App;
